[{'comment_id': 962732660, 'comment_body': 'I'm not a big fan of that `_mergeProducts` method, to say the least.

With those "simple input" classes, we have a very powerful method called `getChangedProduct`, which "transforms" the input product according to the user changes.

A clean way of coding this PR would be:
* I land on a "simple" page.
* I edit some fields.
* I save the page
  * I want the product to be instantly locally refreshed
  * At the same time I queue a call to the server that changes the impacted fields
* For that I need to call `getChangedProduct` twice
  * First time from the product I fetch from the local database (get-product / change-product / save-product), and that I put in the `UpToDateProductProvider`
  * Second time from an empty product (just the barcode) (create-empty-product-with-barcode, change-product, queue-product-server-update)
* Et voilÃ !

If we agree on that, I suggest that you refactor the other input pages in order to include an `AbstractSimpleInputPageHelper`, in order to have the same process for all pages (basically, we always need a helper method that changes a product).', 'comment_created': datetime.datetime(2022, 9, 5, 10, 6, 22, tzinfo=datetime.timezone.utc), 'commenter': 'monsieurtanuki', 'type': 'User'}, {'comment_id': 962867915, 'comment_body': "Hello @monsieurtanuki 

